pragma solidity ^0.8.0;

contract RoleAssignment {
    address public owner;
    mapping(address => bool) public isAdmin;
    mapping(address => bool) public isCouncilMember;
    mapping(address => bool) public isMember;
    mapping(address => bool) public isGuest;

        enum Roles { 
            ADMIN,
            COUNCILMEMBER,
            MEMBER,
            GUEST
        } 
    
    constructor() {
        owner = msg.sender;
        isAdmin[owner] = true;
    }
    
    modifier onlyOwner() {
        require(msg.sender == owner, "Only owner can call this function.");
        _;
    }

    modifier onlyAdmin() {
        require(msg.sender == owner || hasAdminRole(msg.sender), "Only owner can call this function.");
        _;
    }

    function assignRole(Roles _role, address _user) private onlyAdmin {
        
        isAdmin[_user] = false;
        isCouncilMember[_user] = false;
        isMember[_user] = false;
        isGuest[_user] = false;

        if(_role == Roles.ADMIN) {
            isAdmin[_user] = true;
        } else if(_role == Roles.COUNCILMEMBER) {
            isCouncilMember[_user] = true;
        } else if(_role == Roles.MEMBER) {
            isMember[_user] = true;
        } else {
            isGuest[_user] = true;
        }
    }
    
    function assignAdmin(address _user) public onlyAdmin {
        assignRole(Roles.ADMIN, _user);
    }
    
    function assignCouncilMember(address _user) public onlyAdmin {
        assignRole(Roles.COUNCILMEMBER, _user);
    }

    function assignMember(address _user) public onlyAdmin {
        assignRole(Roles.MEMBER, _user);
    }
    
    function assignGuest(address _user) public onlyAdmin {
        assignRole(Roles.GUEST, _user);
    }
    
    function removeRole(address _user) public onlyAdmin {
        assignRole(Roles.GUEST, _user);
    }
    
    function hasAdminRole(address _user) public view returns (bool) {
        return isAdmin[_user];
    }

    function hasCouncilMemberRole(address _user) public view returns (bool) {
        return isCouncilMember[_user];
    }
    
    function hasMemberRole(address _user) public view returns (bool) {
        return isMember[_user];
    }
    
    function hasGuestRole(address _user) public view returns (bool) {
        return isGuest[_user];
    }
}

